def insert_data(data_list):
    
    dynamodb = boto3.resource('dynamodb', region_name='us-east-1')
    table = dynamodb.Table('yelp-restaurants')

    for each_restaurants in data_list:
        
        #Requirements: Business ID, Name, Address, Coordinates, Number of Reviews, Rating, Zip Code)

        dataObject = {
            'id': each_restaurants['id'],
            'name': each_restaurants['name'],
            'categories': each_restaurants['categories'][0]['alias'],
            'location': each_restaurants['location']['address1'],
            'latitude' : str(each_restaurants['coordinates']['latitude']),
            'longitude' : str(each_restaurants['coordinates']['longitude']),
            'review_count': each_restaurants['review_count'],
            'rating': int(each_restaurants['rating']),
            'zip_code': each_restaurants['location']['zip_code']
        }

        print ('dataObject', dataObject)
        
        for data in data_list:
            table.put_item(Item=dataObject)

    